"       </td>",
"       <td>",
"        Binds MHC class I, associated with lck tyrosine kinase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CD11a/CD18 (LFA-1)",
"       </td>",
"       <td>",
"        Binds CD54 (ICAM-1), adhesion, activation",
