var title_f40_17_41244="Manage diastolic HF";
var content_f40_17_41244=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F51637&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F51637&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Management of patients with diastolic heart failure",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <p>",
"         &nbsp;",
"         <strong>",
"          Control edema",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Low salt diet (eg, &lt;2 g sodium per day)",
"         </li>",
"         <li>",
"          Diuretic (eg, furosemide or hydrochlorothiazide)",
"         </li>",
"         <li>",
"          ACE inhibitor* (eg, enalapril or lisinopril)",
"         </li>",
"         <li>",
"          Angiotensin II receptor blocker* (eg, candesartan, valsartan, or losartan)",
"         </li>",
"         <li>",
"          Aldosterone antagonist* (eg, spironolactone)",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          &nbsp;Rate control",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Calcium channel blocker (eg, diltiazem or verapamil)",
"         </li>",
"         <li>",
"          Beta blocker (eg, atenolol, metoprolol)",
"         </li>",
"         <li>",
"          Radiofrequency modification of atrioventricular node and pacing",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         &nbsp;",
"         <strong>",
"          Maintain and restore atrial contraction",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Cardioversion",
"         </li>",
"         <li>",
"          Radiofrequency ablation",
"         </li>",
"         <li>",
"          Antiarrhythmic therapy",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         &nbsp;",
"         <strong>",
"          Manage myocardial ischemia",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Medical management",
"          <ul>",
"           <li>",
"            Nitrates (eg, isosorbide dinitrate or isosorbide mononitrate)",
"           </li>",
"           <li>",
"            Beta blocker (eg, atenolol or metoprolol)",
"           </li>",
"           <li>",
"            Calcium channel blocker (eg, diltiazem or verapamil)",
"           </li>",
"          </ul>",
"         </li>",
"         <li>",
"          Percutaneons coronary intervention",
"         </li>",
"         <li>",
"          Coronary artery bypass surgery",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Control arterial hypertension&bull;",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Diuretic (eg, chlorthalidone or hydrochlorothizide)",
"         </li>",
"         <li>",
"          Beta blocker (eg, atenolol or metoprolol)",
"         </li>",
"         <li>",
"          Calcium channel blocker (eg, amlodipine or felodipine)",
"         </li>",
"         <li>",
"          Angiotensin converting enzyme inhibitor (eg, enalapril or lisinopril)",
"         </li>",
"         <li>",
"          Angiotensin II receptor blocker (eg, candesartan, valsartan, or losartan)",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     *The renin-angiotensin-aldosterone system is inhibited&nbsp;by angiotensin converting enzyme inhibitor, angiotensin II receptor blocker, and&nbsp;aldosterone antagonist and thus these agents have a theoretical benefit in promoting regression of left ventricular hypertrophy and preventing myocardial fibrosis. However more data are required to demonstrate whether they improve outcomes in patients with diastolic heart failure. Two of these three&nbsp;agents may be combined in some patients with proper monitoring but use of all three is generally not recommended.",
"     <br>",
"      &bull; The list of medications is not comprehensive but rather includes examples that are in common clinical use or have been included in studies of patients with diastolic dysfunction or heart failure. A more exhaustive list of antihypertensive agents can be found in the guidelines of the Seventh Report of the Joint National Committee on Prevention, Detection, Evaluation, and Treatment of High Blood Pressure.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Dr. William H. Gaasch.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
